import React, { Component } from "react";
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import ReactTypingEffect from "react-typing-effect";
import "./App.css";
import P5Wrapper from "react-p5-wrapper";

import About from "./components/About";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      // left: "",
      // top: ""
      // x: 0,
      // y: 0
    };
    // this.onMouseMove = this.onMouseMove.bind(this);
  }

  // onMouseMove(e) {
  //   this.setState({ x: e.nativeEvent.offsetX, y: e.nativeEvent.offsetY });
  //   //const node = ReactDOM.findDOMNode(this);
  //   //alert(node);
  //   //const position = node.querySelector("div.pointer").getBoundingClientRect();
  //   // alert(position);
  //   // this.setState({
  //   //   left: position.left,
  //   //   top: position.top
  //   // });
  // }
  sketch1 = p => {
    p.setup = function() {
      p.createCanvas(500, 500);
      p.background(54, 103, 116);
    };

    p.draw = function() {
      if (p.mouseIsPressed) {
        p.fill(236, 236, 231);
      } else {
        p.fill(54, 103, 116);
      }
      p.ellipse(p.mouseX, p.mouseY, 80, 80);
    };
  };

  sketch2 = p => {
    p.setup = function() {
      p.createCanvas(500, 500);
      p.background(236, 236, 231);
    };

    p.draw = function() {
      if (p.mouseIsPressed) {
        p.fill(54, 103, 116);
      } else {
        p.fill(255);
      }
      p.ellipse(p.mouseX, p.mouseY, 80, 80);
    };
  };

  sketch3 = p => {
    p.setup = function() {
      p.createCanvas(500, 500);
      p.background(236, 236, 231);
    };

    p.draw = function() {
      if (p.mouseIsPressed) {
        p.fill(54, 103, 116);
      } else {
        p.fill(255);
      }
      p.ellipse(p.mouseX, p.mouseY, 80, 80);
    };
  };

  sketch4 = p => {
    p.setup = function() {
      p.createCanvas(500, 500);
      p.background(54, 103, 116);
    };

    p.draw = function() {
      if (p.mouseIsPressed) {
        p.fill(236, 236, 231);
      } else {
        p.fill(54, 103, 116);
      }
      p.ellipse(p.mouseX, p.mouseY, 80, 80);
    };
  };

  render() {
    return (
      <div className="app">
        <div className="container">
          <section className="canvas1">
            <P5Wrapper className="p5" sketch={this.sketch1} />
            <div className="box-title">
              <h2 className="box-title-text">Objective opinion about me</h2>
            </div>
          </section>
          <div>
            <section>
              <h2 className="explanation1">Click around before proceed ;)</h2>
            </section>
          </div>
          <section>
            <h2 className="explanation">Click around before proceed ;)</h2>
          </section>
          <section className="canvas1">
            <P5Wrapper className="p5" sketch={this.sketch2} />
            <div className="box-title-light">
              <h2 className="box-title-text">Objective opinion about me</h2>
            </div>
          </section>
        </div>

        <div className="center">
          <h1>
            <ReactTypingEffect text="No nonsense page" eraseDelay="2500" />
          </h1>
        </div>
        <div className="container">
          <section className="canvas1">
            <P5Wrapper className="p5" sketch={this.sketch3} />
            <div className="box-title-light">
              <h2 className="box-title-text">Objective opinion about me</h2>
            </div>
          </section>
          <section>
            <h2 className="explanation">Click around before proceed ;)</h2>
          </section>
          <section className="canvas1">
            <P5Wrapper className="p5" sketch={this.sketch4} />
            <div className="box-title">
              <h2 className="box-title-text">Objective opinion about me</h2>
            </div>
          </section>
        </div>
      </div>
    );
  }
}

export default App;
